void ulpCOMPWheneverFunc( SChar *aTmpStr )
{
/***********************************************************************
 *
 * Description :
 *      WHENEVER  DO function_name    .
 *
 ***********************************************************************/
    SChar sCh;
    idBool sDoBreak;
    // (  
    UInt   sParenNum;
    UInt   sLen;
    UInt   sLen2;

    sDoBreak     = ID_FALSE;
    //  (    .  1.
    sParenNum    = 1;
    sLen2 = sLen = idlOS::strlen( aTmpStr );

    for ( ; sLen < (MAX_EXPR_LEN - 1); sLen++ )
    {
        switch( sCh = yyinput() )
        {
            case ';':
                unput(sCh);
                sDoBreak = ID_TRUE;
                break;
            case ')':
                sParenNum--;
                if( sParenNum <= 0 )
                {
                    sDoBreak = ID_TRUE;
                }
                aTmpStr[sLen] = sCh;
                break;
            case '(':
                sParenNum++;
                aTmpStr[sLen] = sCh;
                break;
            case (SChar) EOF:
                unput(sCh);
                sDoBreak = ID_TRUE;
                break;
            default:
                aTmpStr[sLen] = sCh;
                break;
        }

        if( sDoBreak == ID_TRUE )
        {
            break;
        }
    }

    aTmpStr[++sLen] = '\0';

    gUlpCodeGen.ulpGenQueryString( aTmpStr + sLen2 );
}


